  false,\n\t\"url\": null,\n\t\"notes\": \"This map shows the 2001u20132010 average
  rate of hospitalizations classified as u201cheat-relatedu201d by medical professionals
  in 23 states that participate in CDCu2019s hospitalization tracking program. Rates
  are based on hospital discharge records for May 1 to September 30 of every year.
  Rates have been age-adjusted to account for differences in the population distribution
  over time and between statesu2014for example, if one state has a higher proportion
  of older adults than another. For more information: www.epa.gov/climatechange/science/indicators\",\n\t\"license_title\":
